import React from "react";
import "./Navbar.scss";
import {Link} from "react-router-dom"
const Navbar = () => {
  return (
    <>
      <nav className="Navbar bg-violet">
        <div className="Navbar-content">
          <div className="brand-and-toggle flex">
            <button type="button" className="sidebar-show-btn text-whitesmoke">
              <i className="fas fa-bars"></i>
            </button>
            <Link to = "/" className='navbar-brand flex align-center'>
            <span className='navbar-brand-icon mx-2 fs-lg'>
              <i className='fa-solid fa-bag-shopping'></i>
            </span>
            <span className='navbar-brand-txt mx-2'>
              <span className='fw-7'>Shopping</span>Cart.
            </span>
          </Link>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
